script: |
  super -f text -I q10863.spq | sort > q10863.out

inputs:
  - name: q10863.spq
    data: |
      SELECT DISTINCT + 63 * + col1 + - col2 - + + CAST ( + + 1 AS REAL ) * - col2 / CAST ( NULL AS INTEGER ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 <= + - ( col0 ) * - - col2 / - ( 44 ) + col1 * + col2;
  - name: tab2

outputs:
  - name: q10863.out
    data: |
